INSERT INTO `iter` VALUES (1,'ExtraComunitaria','Si considera il Peso della Bolla Doganale, Immissione in Reg.Doganale con IM7, passaggo a R.Iva con IM4',0,1,1,1,1,0,'select  min( data )  as mindata , sum(netto)  as PesoNetto,  merce, cliente, fornitore, destinazione\r\n from `archivio corretto` where \r\nmerce = \'%M%\' and `num consegna` = \'%C%\'  %ANDS%\r\ngroup by  cliente,  merce, `num consegna` , `num documento`, fornitore, destinazione\r\norder by  min( data )','select   data   , sum( IIF(fornitore = \'0\'  , - netto , netto)) as PesoNetto,  merce , \'%S%\' as fornitore  , destinazione \r\n from `archivio corretto` where \r\nmerce = \'%M%\' and `num consegna` = \'%C%\'  and \r\n(  fornitore = \'%S%\' or ( cliente =  \'%S%\'  and destinazione = 8 ) )\r\nand data =  #%D%#\r\ngroup by  data , fornitore ,  merce, `num consegna` , `num documento`,  IIF(fornitore = \'0\'  , cliente, fornitore ) , destinazione '),(2,'EC Nazionalizzata','Si considera il Peso della Bolla Doganale, Immissione direttamente in Reg.Iva con IM4',0,1,0,1,1,0,'select  min( data )  as mindata , sum(netto)  as PesoNetto,  merce, cliente, fornitore, destinazione\r\n from `archivio corretto` where \r\nmerce = \'%M%\' and `num consegna` = \'%C%\'  %ANDS%\r\ngroup by  cliente,  merce, `num consegna` , `num documento`, fornitore, destinazione\r\norder by  min( data )','select   data   , sum( IIF(fornitore = \'0\'  , - netto , netto)) as PesoNetto,  merce , \'%S%\' as fornitore  , destinazione \r\n from `archivio corretto` where \r\nmerce = \'%M%\' and `num consegna` = \'%C%\'  and \r\n(  fornitore = \'%S%\' or ( cliente =  \'%S%\'  and destinazione = 8 ) )\r\nand data =  #%D%#\r\ngroup by  data , fornitore ,  merce, `num consegna` , `num documento`,  IIF(fornitore = \'0\'  , cliente, fornitore ) , destinazione '),(3,'Comunitaria Glencore','Si considera il Peso della Fattura, Immissione direttamente in Reg.Iva senza IM4',1,0,0,1,1,0,'select  min( data )  as mindata , sum(netto)  as PesoNetto,  merce, cliente, fornitore, destinazione\r\n from `archivio corretto` where \r\nmerce = \'%M%\' and `num consegna` = \'%C%\'  %ANDS%\r\ngroup by  cliente,  merce, `num consegna` , `num documento`, fornitore, destinazione\r\norder by  min( data )','select   data   , sum( IIF(fornitore = \'0\'  , - netto , netto)) as PesoNetto,  merce , \'%S%\' as fornitore  , destinazione \r\n from `archivio corretto` where \r\nmerce = \'%M%\' and `num consegna` = \'%C%\'  and \r\n(  fornitore = \'%S%\' or ( cliente =  \'%S%\'  and destinazione = 8 ) )\r\nand data =  #%D%#\r\ngroup by  data , fornitore ,  merce, `num consegna` , `num documento`,  IIF(fornitore = \'0\'  , cliente, fornitore ) , destinazione '),(4,'Comunitaria NON Glencore','Entra in Reg.Doganale con i singoli pesi, non passa in R.IVA',0,0,1,0,0,1,'select sum(netto) as PesoNetto, data,  merce,  `num consegna` , \'%S%\' as cliente\r\n from `archivio corretto` where \r\ndata = #%D%# and\r\nmerce = \'%M%\' and `num consegna` = \'%C%\'  and \r\n( cliente  = \'%S%\'\r\nor ( fornitore = \'%S%\'  and destinazione = 8 ) )\r\ngroup by data, merce, `num consegna`','select sum( IIF(fornitore = \'0\'  , - netto , netto))  as PesoNetto , data  , merce,  `num consegna`   \r\n, \'%S%\' as fornitore  , destinazione \r\nfrom `archivio corretto` where \r\ndata = #%D%# and \r\nmerce = \'%M%\' and `num consegna` = \'%C%\'  and \r\n(  fornitore = \'%S%\' or ( cliente =  \'%S%\'  and destinazione = 8 ) )\r\ngroup by data, merce, `num consegna` , IIF(fornitore = \'0\'  , cliente, fornitore ) , destinazione ');
